import logo from './logo.svg';
import './App.css';
import Booklist from './components/BooksList/Booklist';

function App() {
  let books = [
    {bookname : "Empower", id : 0},
    {bookname : "Macmalian", id : 1},
    {bookname : "Longman", id : 2},
    {bookname : "Person", id : 3},

  ]

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <Booklist data = {books}/>
        <Booklist data = {"888"}/>

      </header>


    </div>
  );
}

export default App;
